	(134,134,1,'Samantha Lepage','2023-04-11 22:56:47','2023-10-02 16:53:49','b3f90abd-37e4-4814-9b41-50d56aaabe2d',NULL,NULL,NULL,NULL,'Game Guru','teacher help instructions',NULL,NULL,NULL,NULL,'<p>Meet the game guru extraordinaire, Samantha Lepage! If there\'s a game you\'ve been dying to play but don\'t know where to start, Samantha\'s your go-to gal. With her infectious enthusiasm for all things tabletop, she\'s your personal guide to the world of board games. Whether you\'re a newbie looking to learn the ropes or a seasoned pro seeking a fresh challenge, Samantha\'s got the patience and know-how to make your gaming experience a blast. With her by your side, even the most complex strategies will feel like a breeze. So, roll the dice, draw a card, or spin that spinner – Samantha\'s here to make your gaming dreams come true at Ice &amp; Dice!</p>',NULL,NULL,0,NULL),
