	(144,149,1,'Our Games','2023-04-11 23:11:56','2023-04-16 21:28:18','c37df7cb-8017-4087-9266-8f2e89289b3e',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(146,152,1,'Nick Dolman','2023-04-11 23:12:58','2023-10-02 16:53:49','4fe9a508-dfe3-4f46-8e32-c91f855e49fd',NULL,NULL,NULL,NULL,'Game Guru','teacher help instructions',NULL,NULL,NULL,NULL,'<p>Say hello to Nick Dolman, our resident game guru and the mastermind behind the dice-rolling adventures at Ice &amp; Dice! Nick\'s love affair with games started at an early age and has only grown stronger over the years. He\'s the kind of person who can turn even the most intricate rulebooks into an exciting story. Whether you\'re into epic strategy games or quick, casual fun, Nick\'s got the perfect game up his sleeve to match your mood. He\'s not just here to teach you the games; he\'s here to share the joy and camaraderie that come with them. So, if you\'re ready to level up your gaming experience and create lasting memories, Nick is your gaming confidant at Ice &amp; Dice. Get ready to roll the dice and embark on unforgettable adventures with him!</p>',NULL,NULL,0,NULL),
	(147,153,1,'Nick Dolman','2023-04-11 23:13:22','2023-04-13 02:14:28','3ac4bf0b-3f69-4d89-89f9-42c9f2fcfee9',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL),
	(148,154,1,'Brent Chesterfield','2023-04-11 23:13:25','2023-10-02 16:53:51','823248a0-5c13-48e9-b567-1c666613cb40',NULL,NULL,NULL,NULL,'Owner','proprietor founder boss',NULL,NULL,NULL,NULL,'<p>Meet the mastermind behind the dice-rolling, game-loving oasis of fun – Brent Chesterfield! This guy is all about good times, great games, and bringing people together. With a background in all things hospitality and a passion for board games that\'s downright infectious, Brent\'s dream of Ice &amp; Dice was practically destiny. He\'s the friendly face and the brain behind our collection of games and our mouthwatering menu. If you\'re wondering who to thank for your epic game nights and tasty bites, look no further than Brent. He\'s your partner in fun, and he\'s always up for a game or a chat about strategy (over a drink, of course). Come say hi and roll the dice with Brent at Ice &amp; Dice!</p>',NULL,NULL,0,NULL),
