	(633,663,1,'Ashley Kowalski','2023-04-20 12:19:28','2023-10-02 16:53:49','e44e186e-cb14-46d0-a18b-b70ffb4f6f5b',NULL,NULL,NULL,NULL,'Bartender',NULL,NULL,NULL,NULL,NULL,'<p>Meet Ashley Kowalski, the magician behind the bar at Ice &amp; Dice! She\'s not your average bartender; she\'s a concoction creator, a mood-setter, and a master of mixing. Ashley knows that every great game night needs the perfect drink to complement it, and she\'s got a menu of creative libations that will take your taste buds on an epic adventure. Whether you\'re in the mood for a classic cocktail or a custom concoction, Ashley\'s friendly smile and bartending expertise make every drink an experience. She\'s not just here to serve; she\'s here to enhance your gaming journey, one sip at a time. So, raise your glass to good times and great games, and let Ashley craft the perfect beverage to make your night at Ice &amp; Dice truly exceptional!</p>',NULL,NULL,0,NULL),
