	(1107,1257,1,'Brent Chesterfield','2023-09-02 16:34:53','2023-09-02 16:34:53','07781831-07ad-40ac-ad79-60e0fbcefb49',NULL,NULL,NULL,NULL,'Owner & Founder',NULL,NULL,NULL,NULL,NULL,'<p>Meet the mastermind behind the dice-rolling, game-loving oasis of fun – Brent Chesterfield! This guy is all about good times, great games, and bringing people together. With a background in all things hospitality and a passion for board games that\'s downright infectious, Brent\'s dream of Ice &amp; Dice was practically destiny. He\'s the friendly face and the brain behind our collection of games and our mouthwatering menu. If you\'re wondering who to thank for your epic game nights and tasty bites, look no further than Brent. He\'s your partner in fun, and he\'s always up for a game or a chat about strategy (over a drink, of course). Come say hi and roll the dice with Brent at Ice &amp; Dice!</p>',NULL,NULL,NULL,NULL),
	(1109,1259,1,'Samantha Lepage','2023-09-02 16:35:37','2023-09-02 16:35:37','809094ca-cec6-4ba8-90a9-b1ec4d46b021',NULL,NULL,NULL,NULL,'Game Guru',NULL,NULL,NULL,NULL,NULL,'<p>Meet the game guru extraordinaire, Samantha Lepage! If there\'s a game you\'ve been dying to play but don\'t know where to start, Samantha\'s your go-to gal. With her infectious enthusiasm for all things tabletop, she\'s your personal guide to the world of board games. Whether you\'re a newbie looking to learn the ropes or a seasoned pro seeking a fresh challenge, Samantha\'s got the patience and know-how to make your gaming experience a blast. With her by your side, even the most complex strategies will feel like a breeze. So, roll the dice, draw a card, or spin that spinner – Samantha\'s here to make your gaming dreams come true at Ice &amp; Dice!</p>',NULL,NULL,NULL,NULL),
	(1111,1261,1,'Nick Dolman','2023-09-02 16:36:08','2023-09-02 16:36:08','d9712d4c-0076-41bc-875b-7873cd89f4f6',NULL,NULL,NULL,NULL,'Game Guru',NULL,NULL,NULL,NULL,NULL,'<p>Say hello to Nick Dolman, our resident game guru and the mastermind behind the dice-rolling adventures at Ice &amp; Dice! Nick\'s love affair with games started at an early age and has only grown stronger over the years. He\'s the kind of person who can turn even the most intricate rulebooks into an exciting story. Whether you\'re into epic strategy games or quick, casual fun, Nick\'s got the perfect game up his sleeve to match your mood. He\'s not just here to teach you the games; he\'s here to share the joy and camaraderie that come with them. So, if you\'re ready to level up your gaming experience and create lasting memories, Nick is your gaming confidant at Ice &amp; Dice. Get ready to roll the dice and embark on unforgettable adventures with him!</p>',NULL,NULL,NULL,NULL),
	(1113,1263,1,'Ashley Kowalski','2023-09-02 16:36:39','2023-09-02 16:36:39','bd43f591-577c-4c8a-a7df-545408e8bc80',NULL,NULL,NULL,NULL,'Bartender',NULL,NULL,NULL,NULL,NULL,'<p>Meet Ashley Kowalski, the magician behind the bar at Ice &amp; Dice! She\'s not your average bartender; she\'s a concoction creator, a mood-setter, and a master of mixing. Ashley knows that every great game night needs the perfect drink to complement it, and she\'s got a menu of creative libations that will take your taste buds on an epic adventure. Whether you\'re in the mood for a classic cocktail or a custom concoction, Ashley\'s friendly smile and bartending expertise make every drink an experience. She\'s not just here to serve; she\'s here to enhance your gaming journey, one sip at a time. So, raise your glass to good times and great games, and let Ashley craft the perfect beverage to make your night at Ice &amp; Dice truly exceptional!</p>',NULL,NULL,NULL,NULL),
	(1115,1265,1,'Monica Smyth','2023-09-02 16:37:08','2023-09-02 16:37:08','40ebb16c-a784-4439-ae9b-48630271e3f9',NULL,NULL,NULL,NULL,'Bartender',NULL,NULL,NULL,NULL,NULL,'<p>Introducing Monica Smyth, the spirited mixologist and friendly face behind the bar at Ice &amp; Dice! With her passion for crafting creative cocktails and her warm hospitality, Monica is your go-to for liquid delights that\'ll elevate your gaming experience to a whole new level. Whether you\'re craving a classic concoction or looking to embark on a taste adventure with one of her signature specials, Monica\'s got you covered. She\'s not just a bartender; she\'s a drink architect, and each sip from her shaker is a testament to her artistry. So, when you\'re ready to add a dash of flavor and a splash of fun to your game night, head over to Monica at Ice &amp; Dice, and let her pour some magic into your glass!</p>',NULL,NULL,NULL,NULL),
