	(1881,2065,1,'King of Tokyo Tournament','2023-09-08 12:31:38','2023-09-08 12:31:38','6f624836-3a27-49aa-aa08-1b99f55f1bbb',NULL,NULL,NULL,NULL,NULL,NULL,'2023-11-04 18:30:00',NULL,NULL,NULL,'<p>Get ready to unleash your inner monster at Ice &amp; Dice\'s King of Tokyo Tournament! Join us for an epic showdown where you\'ll battle it out with fellow board game enthusiasts to claim the title of King (or Queen) of Tokyo. Roar, stomp, and strategize your way to victory in this high-energy, dice-rolling competition. Prizes, bragging rights, and loads of fun await the victor, so assemble your team of monsters and roll your way to glory. Whether you\'re a seasoned Tokyo veteran or a newcomer to the city, this tournament promises heart-pounding excitement and monstrous memories. Mark your calendars and bring your A-game because the crown is up for grabs, and only the mightiest will claim it at Ice &amp; Dice!</p>',5,NULL,NULL,NULL),
	(1882,2066,1,'Disney Lorcana Introductory Tournament','2023-09-08 12:32:30','2023-10-02 16:53:46','38c7b98e-0618-43dd-916d-fa5429f06687',NULL,NULL,NULL,NULL,NULL,NULL,'2023-10-07 00:00:00',NULL,'5',NULL,'<p>Step into the enchanting world of Disney Lorcana at Ice &amp; Dice\'s Introductory Tournament! Join us for a magical day of strategy, spells, and your favorite Disney characters in a whole new light. Whether you\'re a novice or a seasoned card duelist, this event is your gateway to the captivating realm of Lorcana, where Disney heroes and villains clash in epic battles of wit and sorcery.</p><p>Expect to be spellbound as you assemble your deck, choose your side, and immerse yourself in the whimsical yet fiercely competitive world of Disney Lorcana. Prizes, surprises, and endless Disney-themed fun await the champions of the day.</p><p>Bring your friends, bring your Disney knowledge, and bring your game face because this is your chance to prove you\'ve got what it takes to reign supreme in the most enchanting card game ever. Whether you\'re looking to learn the ropes or showcase your skills, this tournament is a tale as old as time you won\'t want to miss at Ice &amp; Dice!</p>',4,NULL,0,NULL),
	(1883,2067,1,'Disney Lorcana Introductory Tournament','2023-09-08 12:33:04','2023-09-08 12:33:04','4a4a6ef6-e450-4b23-a790-d0c0d49d5407',NULL,NULL,NULL,NULL,NULL,NULL,'2023-10-07 00:00:00',NULL,NULL,NULL,'<p>Step into the enchanting world of Disney Lorcana at Ice &amp; Dice\'s Introductory Tournament! Join us for a magical day of strategy, spells, and your favorite Disney characters in a whole new light. Whether you\'re a novice or a seasoned card duelist, this event is your gateway to the captivating realm of Lorcana, where Disney heroes and villains clash in epic battles of wit and sorcery.</p><p>Expect to be spellbound as you assemble your deck, choose your side, and immerse yourself in the whimsical yet fiercely competitive world of Disney Lorcana. Prizes, surprises, and endless Disney-themed fun await the champions of the day.</p><p>Bring your friends, bring your Disney knowledge, and bring your game face because this is your chance to prove you\'ve got what it takes to reign supreme in the most enchanting card game ever. Whether you\'re looking to learn the ropes or showcase your skills, this tournament is a tale as old as time you won\'t want to miss at Ice &amp; Dice!</p>',4,NULL,NULL,NULL),
	(1884,2068,1,'2023 Netrunner World Championship Viewing Party (Live From Barcelona)','2023-09-08 12:34:07','2023-10-02 16:53:46','b53964c4-adcb-45cc-a06c-125fbfc2d13c',NULL,NULL,NULL,NULL,NULL,NULL,'2023-10-15 19:00:00',NULL,NULL,NULL,'<p>Join us for an electrifying evening at Ice &amp; Dice as we bring the adrenaline-fueled world of Netrunner to our screens with our livestream viewing party of the top cut from the 2023 Netrunner Worlds Tournament in Barcelona!</p><p>On Sunday, October 15th, we\'re turning our cafe into a virtual hub for all things Netrunner, where you can witness the world\'s top players compete in the ultimate cyber-battle. Settle into our comfortable lounge, grab your favorite snacks and drinks, and get ready for a front-row seat to the high-stakes action of this prestigious tournament.</p><p>Whether you\'re a seasoned Netrunner pro or a newbie looking to dive into the world of cybernetic intrigue, this event is your chance to soak up the strategies, drama, and excitement of competitive Netrunner. Discuss strategies, make predictions, and cheer on your favorite players as we watch the best of the best clash in the digital realm.</p>',6,NULL,0,NULL),
