	(1949,2138,1,'Samantha Lepage','2023-09-13 13:00:27','2023-09-13 13:00:27','076955fa-4dce-434f-9702-f97f08ac2de1',NULL,NULL,NULL,NULL,'Game Guru','teacher help instructions',NULL,NULL,NULL,NULL,'<p>Meet the game guru extraordinaire, Samantha Lepage! If there\'s a game you\'ve been dying to play but don\'t know where to start, Samantha\'s your go-to gal. With her infectious enthusiasm for all things tabletop, she\'s your personal guide to the world of board games. Whether you\'re a newbie looking to learn the ropes or a seasoned pro seeking a fresh challenge, Samantha\'s got the patience and know-how to make your gaming experience a blast. With her by your side, even the most complex strategies will feel like a breeze. So, roll the dice, draw a card, or spin that spinner – Samantha\'s here to make your gaming dreams come true at Ice &amp; Dice!</p>',NULL,NULL,0,NULL),
	(1951,2140,1,'Nick Dolman','2023-09-13 13:00:34','2023-09-13 13:00:34','e29cb06b-70b4-4a2d-95ab-3ed0cc2103fa',NULL,NULL,NULL,NULL,'Game Guru','teacher help instructions',NULL,NULL,NULL,NULL,'<p>Say hello to Nick Dolman, our resident game guru and the mastermind behind the dice-rolling adventures at Ice &amp; Dice! Nick\'s love affair with games started at an early age and has only grown stronger over the years. He\'s the kind of person who can turn even the most intricate rulebooks into an exciting story. Whether you\'re into epic strategy games or quick, casual fun, Nick\'s got the perfect game up his sleeve to match your mood. He\'s not just here to teach you the games; he\'s here to share the joy and camaraderie that come with them. So, if you\'re ready to level up your gaming experience and create lasting memories, Nick is your gaming confidant at Ice &amp; Dice. Get ready to roll the dice and embark on unforgettable adventures with him!</p>',NULL,NULL,0,NULL),
