	(2058,2275,1,'Nick Dolman','2023-10-02 15:53:31','2023-10-02 15:53:31','9ea1cf24-5e1b-4d89-9214-b081ae35fb11',NULL,NULL,NULL,NULL,'Game Guru','teacher help instructions',NULL,NULL,NULL,NULL,'<p>Say hello to Nick Dolman, our resident game guru and the mastermind behind the dice-rolling adventures at Ice &amp; Dice! Nick\'s love affair with games started at an early age and has only grown stronger over the years. He\'s the kind of person who can turn even the most intricate rulebooks into an exciting story. Whether you\'re into epic strategy games or quick, casual fun, Nick\'s got the perfect game up his sleeve to match your mood. He\'s not just here to teach you the games; he\'s here to share the joy and camaraderie that come with them. So, if you\'re ready to level up your gaming experience and create lasting memories, Nick is your gaming confidant at Ice &amp; Dice. Get ready to roll the dice and embark on unforgettable adventures with him!</p>',NULL,NULL,0,NULL),
