	(878,'field',7,1,' if youre looking for a unique and entertaining date night idea why not try playing some board games together not only are board games a fun way to spend time together but they can also be a great way to get to know each other better here are ten of the best board games for a romantic night in at a board game cafe jaipur a fast paced card game that has players buying and selling goods in a bustling indian market is a strategic game thas easy to learn and offers plenty of replayability codenames duet a cooperative game where players must work together to identify secret agents without accidentally revealing the assassins is a great game to play with someone you trust and know well azul a beautiful and engaging game where players must decorate the walls of a royal palace with colorful tiles is a great game for anyone who loves puzzles and patterns patchwork a two player game where players compete to create the best patchwork quilt is a strategic game that offers plenty of opportunity for clever play hive a two player game where players control a swarm of insects and must outmaneuver their opponent to win is a strategic game thas easy to learn but challenging to master santorini a two player game that has players building a beautiful island city is a game thas easy to learn but offers plenty of strategic depth lost cities a two player card game where players are explorers trying to find ancient treasures is a quick and easy game to learn but offers plenty of opportunity for clever play azul summer pavilion a sequel to the original azul game this two player game has players creating beautiful mosaic patterns using tiles is easy to learn but offers plenty of strategic depth star realms a two player deck building game set in space where players must build up their fleet of spaceships and defeat their opponent is a quick and engaging game that offers plenty of replayability fox in the forest a two player trick taking game where players must win tricks while avoiding taking too many is a quick and easy game to learn but offers plenty of strategic depth and replayability whether youre looking for a quick game or a more involved strategy game there are plenty of great board games out there for a romantic night in so head to your local board game cafe and try out one of these fantastic games with your special someone '),
