	(918,'field',7,1,' board games have always been a popular form of entertainment for people of all ages theres something about gathering around a table with friends and family to play a game that creates a sense of camaraderie and fun thas why the opening of a new board game cafe in town called ice dice is creating quite a buzz located in the heart of the city ice dice is a unique concept that combines the joys of playing board games with the pleasures of indulging in delicious food and beverages the space has been designed to provide a comfortable and inviting atmosphere where customers can come and enjoy a variety of games while savoring their favorite snacks and drinks construction of the cafe has been ongoing for the past several months with a focus on creating an ambiance that is warm welcoming and cozy the decor is a blend of modern and vintage with comfortable seating options and plenty of natural light one of the highlights of the cafe is its impressive collection of board games which includes everything from classic titles like monopoly and scrabble to newer and more complex games like settlers of catan and pandemic the owners of the cafe have also made a point of sourcing unique and hard to find games from all over the world ensuring that theres always something new and exciting to try the menu at ice dice has been carefully curated to cater to a diverse range of tastes and preferences customers can choose from a variety of delicious snacks like charcuterie boards loaded nachos and gourmet popcorn as well as heartier fare like burgers sandwiches and salads the drink menu is equally impressive with a selection of craft beers specialty cocktails and locally roasted coffee the owners of ice dice are excited to welcome customers to their new venture and are planning a grand opening event to celebrate the event will feature live music games tournaments and special deals on food and drinks they hope that the cafe will become a hub for the local gaming community 